    .post(
      VIEW_RECORDS_URL,
      {
        token: token,
        userId: userId,
      },
      {
        headers: { "Content-Type": "application/json" },
        withCredentials: true,
      }
    )
    .then(function (response) {
      setHealthRecords(response.healthRecords);
      setExamRecords(response.examRecords);
      setSuccess(true);
      setBuffer(false);
    })
    .catch(function (err) {
      // const response = {
      //   healthRecords: {
      //     name: "Patient Kelly",
      //     dateofbirth: "1999-01-08",
      //     height: 155,
